import style from './SearchBar.module.css'

const SearchBar = (onSearch) => {
   return (
      <div className={style.search}>
         <input type='search' />
         <button className={style.button} onClick={onSearch}>Agregar</button>
      </div>
   );
}

export default SearchBar
